import React from 'react';
import './sections.css';

class Sections extends React.Component{
    constructor(){
        super();
        this.state={
            sections: 'About Me: '
        }
    }
    render(){
        return(
            <div className='sections'>
                {this.state.sections}
            </div>
        );
    }
}

export default Sections;
